import fotoCapa from 'assets/sobre_mim_capa.png';

export default function SobreMim() {
    return (
        <PostModelo
            fotoCapa={fotoCapa}
            titulo="Sobre Mim"
        >
            <h3 className={StyleSheet.subtitulo}></h3>
        </PostModelo>
    )
}
